// export default ParallelCoordinatesPlot;
import React, { useEffect, useRef } from "react";
import * as d3 from "d3";

const ParallelCoordinatesPlot = ({ data, dimensions }) => {
    const containerRef = useRef();

    useEffect(() => {
        // Log the incoming data and dimensions
        console.log("Data:", data);
        console.log("Dimensions:", dimensions);

        if (!data || !dimensions) return;

        // Clear any previous rendering
        d3.select(containerRef.current).selectAll("*").remove();

        // Set margins and dimensions
        const margin = { top: 30, right: 50, bottom: 10, left: 50 };
        const width = 900 - margin.left - margin.right;
        const height = 500 - margin.top - margin.bottom;

        // Create SVG
        const svg = d3
            .select(containerRef.current)
            .append("svg")
            .attr("width", width + margin.left + margin.right)
            .attr("height", height + margin.top + margin.bottom)
            .append("g")
            .attr("transform", `translate(${margin.left},${margin.top})`);

        // Y-scales for each dimension
        const yScales = {};
        dimensions.forEach((dim) => {
            yScales[dim] = d3
                .scaleLinear()
                .domain(d3.extent(data, (d) => d[dim]))
                .range([height, 0]);
        });

        // X-scale for dimensions
        const xScale = d3.scalePoint().domain(dimensions).range([0, width]);

        // Line color scale
        const colorScale = d3
            .scaleSequential(d3.interpolateViridis)
            .domain(d3.extent(data, (d) => d[dimensions[0]]));

        // Add axes
        svg.selectAll(".dimension")
            .data(dimensions)
            .enter()
            .append("g")
            .attr("class", "dimension")
            .attr("transform", (d) => `translate(${xScale(d)})`)
            .each(function (dim) {
                d3.select(this)
                    .call(d3.axisLeft(yScales[dim]))
                    .append("text")
                    .attr("text-anchor", "middle")
                    .attr("y", -15)
                    .text(dim)
                    .style("fill", "black");
            });

        // Draw lines
        svg.append("g")
            .selectAll(".path")
            .data(data)
            .enter()
            .append("path")
            .attr("d", (d) =>
                d3.line()(
                    dimensions.map((dim) => [
                        xScale(dim),
                        yScales[dim](d[dim]),
                    ])
                )
            )
            .style("fill", "none")
            .style("stroke", (d) => colorScale(d[dimensions[0]]))
            .style("stroke-width", 1.5)
            .style("opacity", 0.7);

        // Add color legend
        const legendWidth = 10;
        const legendHeight = 200;

        const legendSvg = svg
            .append("g")
            .attr("transform", `translate(${width + 20}, 0)`);

        const gradient = legendSvg
            .append("defs")
            .append("linearGradient")
            .attr("id", "color-gradient")
            .attr("gradientUnits", "userSpaceOnUse")
            .attr("x1", "0%")
            .attr("x2", "0%")
            .attr("y1", "0%")
            .attr("y2", "100%");

        gradient
            .append("stop")
            .attr("offset", "0%")
            .attr("stop-color", d3.interpolateViridis(1));
        gradient
            .append("stop")
            .attr("offset", "100%")
            .attr("stop-color", d3.interpolateViridis(0));

        legendSvg
            .append("rect")
            .attr("width", legendWidth)
            .attr("height", legendHeight)
            .style("fill", "url(#color-gradient)");

        const colorDomain = d3.extent(data, (d) => d[dimensions[0]]);
        const legendScale = d3
            .scaleLinear()
            .domain(colorDomain)
            .range([0, legendHeight]);

        const legendAxis = d3
            .axisRight(legendScale)
            .ticks(6)
            .tickFormat(d3.format(".1f"));

        legendSvg
            .append("g")
            .attr("transform", `translate(${legendWidth}, 0)`)
            .call(legendAxis);
    }, [data, dimensions]);

    return <div ref={containerRef}></div>;
};

export default ParallelCoordinatesPlot;
